import { MarkerQuery, MarkersMap } from './'

export const MarkersController = ({ control, ...rest }) => {
  switch (control) {
    case 'MarkersMap': {
      return <MarkersMap rest={ rest } />
    }
    case 'MarkerQuery': {
      return <MarkerQuery rest={ rest } />
    }
    default:
      return null
  }
}
